import React from 'react';

function YearTabs(props) {
    const handleYearChange = (e) => {
        props.year[e.target.name] = !props.year[e.target.name];
    };

    return (
        <div className="flex justify-center px-8">
            <div className="grid w-full grid-cols-4">
                <button className="px-4 py-2 bg-gray-600 relative z-10 rounded-l-2xl border text-gray-300 border-gray-400 hover:bg-gray-400 hover:text-gray-100" onClick={ handleYearChange }>
                    Freshman
                </button>
                <button className="px-4 py-2 bg-gray-600 relative z-10 border text-gray-300 border-gray-400 hover:bg-gray-400 hover:text-gray-100" onClick={ handleYearChange }>
                    Sophomore
                </button>
                <button className="px-4 py-2 bg-gray-600 relative z-10 border text-gray-300 border-gray-400 hover:bg-gray-400 hover:text-gray-100" onClick={ handleYearChange }>
                    Junior
                </button>
                <button className="px-4 py-2 bg-gray-600 relative z-10 rounded-r-2xl border text-gray-300 border-gray-400 hover:bg-gray-400 hover:text-gray-100" onClick={ handleYearChange }>
                    Senior
                </button>
            </div>
        </div>
    );
}

export default YearTabs;
